import React from "react";


import classes from './TopInfoBar.module.css';



const TopInfoBar=()=>{


return (



<div className={classes.topInfoBar}>

	<div className={classes.topInfoBar__instructor}> <i className={classes.topInfoBar__instructorName}>Instructor: Prof. Seema Bahinipati</i></div>

        <div className={classes.topInfoBar__profilebtn}> profile  </div>

        <div className={classes.topInfoBar__settingsbtn}> settings  </div>

        <div className={classes.topInfoBar__coursesbtn}> courses  </div>



</div>



);

}


export default TopInfoBar;
